import React from "react";
import NavBar from "./NavBar";
import Hero from "./Hero";
import Footer from "./Footer";
import './App.css'
import firstA from './images/tall-building.jpg';
import secondA  from './images/waterfall.jpg';
import thirdA from './images/underground-aquarium.jpg'
import first from './images/pretty-drops.jpg' 
import second from './images/pretty-bubble.jpg' 
import third from './images/pretty-waves.jpg' 
import fourth from './images/superb-vase.jpg' 
import fifth from './images/shiny-floor.jpg' 
import sixth from './images/sunset-and-mountain.jpg' 
import seventh from './images/tall-building.jpg' 
import eight from './images/texas-night.jpg' 
import ninth from './images/snowy-environ.jpg' 
import tenth from './images/underground-aquarium.jpg'
export default function App() {
    return (
        <div>
          <NavBar />
          <div className="cool-photo-container">
               <Hero 
                  image={first}
               />
               <Hero 
                  image={second}
               />    
               <Hero 
                  image={third}
               />
               <Hero 
                  image={fourth}
               />             
               <Hero 
                  image={fifth}
               />    
               <Hero 
                  image={sixth}
               />    
               <Hero 
                  image={seventh}
               />    
               <Hero 
                  image={eight}
               />    
               <Hero 
                  image={ninth}
               />    
               <Hero 
                  image={tenth}
               />    
        </div>
        <h1 className="cool-photo-header">Online Experiences</h1>
        <p className="cool-photo-para">Join unique interactive activities led by one-of-a-kind hosts-all without leaving home.
        </p>
           <footer className="footer">
                <Footer 
                        image={firstA}
                        about="A fascinatingA building"
                />
                <Footer
                        image={secondA}
                        about="Gurara Falls at Lekki Phase 2"
                />
                <Footer
                        image={thirdA}
                        about="Underground Aquarium"
                />
           </footer>
        </div>
    );
}
